import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchCompany } from "../store/slices/companySlice.js";

export default function Dashboard() {
  const dispatch = useDispatch();
  const { profile, loading } = useSelector(s => s.company);

  useEffect(()=> { dispatch(fetchCompany()); }, [dispatch]);

  if (loading) return <div>Loading...</div>;

  return (
    <div className="p-8">
      <h1 className="text-2xl mb-4">Dashboard</h1>
      {!profile ? (
        <p>No company profile yet. <a href="/onboard">Create profile</a></p>
      ) : (
        <div>
          <img src={profile.banner_url} alt="banner" style={{maxWidth: 600}} />
          <h2>{profile.company_name}</h2>
          <p>{profile.description}</p>
        </div>
      )}
    </div>
  );
}
